-- TOC entry 235 (class 1259 OID 106379)
-- Name: vbooks; Type: VIEW; Schema: public; Owner: -
--

CREATE VIEW public.vbooks AS
 SELECT b.book_id,
    b.book_title,
    b.cover_page,
    b.isbn,
    b.language_idlanguage,
    l.language_name,
    floor(avg(r.value)) AS book_rating
   FROM public.reviews r,
    public.books b,
    public.language l
  WHERE ((b.book_id = r.books_book_id) AND ((l.idlanguage)::text = (b.language_idlanguage)::text))
  GROUP BY b.book_id, b.book_title, b.cover_page, b.isbn, b.language_idlanguage, l.language_name;


